  return (
    <div className={c.cadrs}>
        <CardItem text="Спосіб оплати" image={image1}/>
        <CardItem text="Безкоштовна доставка" image={image1}/>
        <CardItem text="Політика повернення" image={image1}/>
        <CardItem text="Підтримка клієнтів" image={image1}/>
    </div>
 )
}
